import React from "react";
import { fc } from "react-icons";

const Card = (props) => {
  return (
    <div>
      <div>
        <img src={course.image.url}></img>

        <div>
          <button>
            <fc fontSize="1.75rem"></fc>
          </button>
        </div>
      </div>
      <div>
        <p>{course.title}</p>
        <p>{course.description}</p>
      </div>
    </div>
  );
};

export default Card;
